import { Document, Page } from 'react-pdf';
import { Paper } from '@material-ui/core';

export default function Resume() {
  return (
    <Paper>
      <Document
        file="my-pdf-file.pdf"
        onLoadSuccess={() => console.log('PDF loaded successfully')}
      >
        <Page pageNumber={1} />
      </Document>
    </Paper>
  );
}
